import React from "react";
import PageHeader from "../../components/PageHeader/PageHeader";
import DefaultButton from "../../components/DefaultButton/DefaultButton";
import { useNavigate } from 'react-router-dom';
import { FooterContainer } from '../../containers/footer';
export { registerNewCustomer } from "../../actions/authenticationAction";
import styles from './Register.css';

const Register = () => {

    const navigate = useNavigate();

    const onRegister = async () => {
        const data = {
            firstname: document.getElementById("firstname").value,
            lastName: document.getElementById("lastname").value,
            email: document.getElementById("email").value,
            phoneNumber: document.getElementById("phonenumber").value,
            username: document.getElementById("username").value,
            password: document.getElementById("password").value,
        };

        console.log('Data being sent to post request:', data);
        const registerAccount = await registerNewCustomer(data);
        console.log('Registering user:', registerAccount);

        navigate('/offers');

    };

    return (
        <div>
            <PageHeader/>
            <div className="title">
                <label>Register your account</label>
            </div>
            <div className="below-title">
                <div className="main-container">
                    <div className="labels">
                        <label>First name:</label>
                        <label>Last name:</label>
                        <label>Email address:</label>
                        <label>Phone number:</label>
                        <label>Username:</label>
                        <label>Password:</label>
                    </div>
                    <div className="inputs">
                        <input type="text" id="firstname"/>
                        <input type="text" id="lastname"/>
                        <input type="text" id="phonenumber"/>
                        <input type="text" id="username"/>
                        <input type="text" id="email"/>
                        <input type="text" id="password"/>
                    </div>
                </div>
            </div>
            <div>
                <DefaultButton
                    text={'Register'}
                    onPress={onRegister}
                    disabled={false}
                />
            </div>
            <FooterContainer />
        </div>
    );
};

export default Register;
